def gamma(n):
    if n.is_integer():
        # Calculate the gamma function of an integer
        result = math.gamma(int(n))
    elif n == (0.5):
        result = "\sqrt{\pi}"  #
    else:
        # Calculate the gamma function of a float
        result = math.gamma(round(n, 3))
    return result


